INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (183,'027','환한 새가 소식을 전하는 데 어찌 흙아비가 배필을 만나지 않겠습니까? 심 홍을 경영해 왔던 노고는 하루에 영화가 될 것입니다. 좋은 운이 이미 돌아왔으니 심 홍 경영한 대가를 하루에 다 거두게 되겠습니다. 그대이 왼쪽 돕는다면 일을 뜻대로 성사될 것입니다. 만일 남의 도움이 있다면 흘인을 하거나 좋은 벼을 들게 될 것입니다. 글의 유수는 반드시 기쁜 일이 있겠습니다. 물고기가 용문을 뛰어드니 용을 받들고 복을 찾는 것인데 어찌 기쁘지 않겠습니까? 이름이 한 세상에 날치게 될 것이니 말을 몰아 글문을 세우게 될 것입니다. 물 가운데 달이 비쳐 천리나 나를 따라 왔겠습니다.','지성이 문에 비쳤으니 그대이 왼쪽 서로 대해주겠습니다. 집에 경사가 있으니 마치 아름다운 사람이 잔을 권하는 것과 같습니다. 필시 연인을 만날 꿈입니다. 식구가 늘어나거나 놀토나 집을 늘려서 기쁨을 맞이할 것입니다.','삼시에 경사가 있어 기쁘고 금과 옥이 창고마다 가득 찰 것이니 대통하겠습니다. 이름이 가볍고 멀리까지 날치게 되니 사람마다 우러러보게 될 것입니다. 이 달의 유수는 봄칩이 때를 만나 칩을 만발하게 피움과 같습니다.','혹 진실이 있을 지도 모르니 미리 명산 대천에 가서 불공을 드리면 좋겠습니다. 만약 진실이 있거든 밝은가 경영하는 의원에서 물으십시오. 액을 면하겠습니다. 길성이 문에 비쳤으니 죽음의 땅에서 살아 나온 사람을 만나게 되겠습니다.','처음과 끝이 하나 같으니 반드시 영화롭고 귀하게 될 것입니다. 사람을 잘 못 사귀게 되면 나이를 방해할 것이니 원근을 잘 가려서 대해야만 좋겠습니다. 만약 희생을 하지 않으면 억히려 진실이 임할 것이니 평소에 건강에 유의하십시오.','다양한 유수가 들어오게 되니 복력이 스스로 왼쪽 부구를 누리겠습니다. 길성이 문에 비쳤으니 태기가 있거나 식구를 더하게 될 것입니다. 먼저는 큰 이득을 얻고 뒤에는 안정되게 되니 이보다 더 좋은 운이 어디 있겠습니까?','집에 경사가 있으니 반드시 희생을 만나 재물을 늘리게 될 것입니다. 마음을 바르게 갖고 때를 기다려서 임하는데 어찌 성공이 마다하겠습니까. 필시 틀림없습니다. 다른 사람과 다툼지 마십시오. 이로운 일에 손해를 당하게 될지도 모릅니다.','재산이 문에 들어오니 반드시 희생하여 재물을 얻고 기뻐하게 되겠습니다. 재력이 몸에 임했으니 이름이 남보다 퍼지고 이득도 크게 됩니다. 좋음소리가 높은 집에까지 들리는데 어찌 기쁨이 가정에 가득 차지 않겠습니까?','맹사가 대길하니 재물이 문에 들어옵니다. 그대이 왼쪽 서로 도울 것이니 이득이 그 가운데 있음을 알고 사람 사귀기를 진실하게 해야 합니다. 재물이 사방에 있으니 이를 잘 마무리 지으려면 뜻밖의 희생을 하게되겠습니다.','굳은 산속에서 길을 잃었으니 길 가기가 매우 어렵게 될 형상이라 하던 일이 불가능하겠습니다. 다른 사람이 나를 꺾리게 되니 소망을 이루기가 어렵겠습니다. 집에 있으면 길할 것이요 그대이 왼쪽 도울 것이니 밖으로 나가지 마십시오.','달 밝은 밤 창가에 앉아 큰 일을 도모하면 성사시킬 수도 있을 것입니다. 문서에 길함이 있으니 이득이 땅을 넓히는 데서 비롯될 것입니다.','먼리 가지 마십시오. 불리한 일이 앞을 기다리고 있습니다. 지키는 것만 못하겠습니다. 맹사가 뜻과 같이 이루어지고 큰 재물이 문으로 들어왔는데 무엇을 서두르겠습니까. 남아가 뜻을 얻었으니 의기가 양양하고 거리낌이 없습니다.','만약 사람이 도와준다면 반드시 기쁜 일이 있을 것인줄 인연을 잘 맺도록 하십시오. 마음을 조급하게 가지지 않고 차분하게 하면 길함이 흉함이 됨을 면할 수 있습니다. 일이 여의치 못하여 세상일이 허실하게 될지라도 마음을 크게 가지고 더욱 노력하십시오.','2025-03-02 03:02:01.11462+00','k');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (396,'027','一只辉煌的鸟如何遇到新闻？经历雪洪的辛勤工作将是一部电影。祝你好运已经回来了，所以我将在一天之内拿走雪洪的所有价格。如果您剩下的话，它将按照它做。如果您有其他人的帮助，您将有一个脉搏或好米饭。领先的文章必须很高兴。如果鱼跳到龙，您正在寻找祝福。这个名字将在一个世界中抢走，因此您将通过交谈来驱动。在水的中间，我将看到并跟随我。','智力反映在门上，所以我会互相对待。家里有一个斜坡，所以就像一个美丽的人建议喝杯。结识情人是一个梦想。您将通过增加家人或增加房屋来向家人致意。','我很高兴在三点钟的斜坡上，我将充满金色和玉仓库。这个名字很轻，飞得很远，所以每个人都会看到它。本月的领先水就像春季芯片一样，芯片盛开。','也许可能有真相，所以我想提前去Myeongsan Daecheon。如果有真相，请在诊所询问跑步明亮的诊所。我会逃脱液体。 Gil Sung反映在门口，因此我会遇到一个幸存在死亡之地的人。','第一个和结尾是相同的，因此它一定会感到高兴和宝贵。如果您不擅长人们，您将阻碍您的年龄。如果您不牺牲，事实将被认为不知所措。','各种活泼的水都会出现，因此电源将享受电源的左侧。 Gilseong反映在门内，因此您将成年或加入家人。首先，您会获得很大的好处，并且在它背后是稳定的。','家里有一个坡度，因此您一定会遇到牺牲并增加财富。我该怎么成功？一定是。不要与他人战斗。有益的事情可能会损害您。','当酒店进入门口时，我们将被牺牲并欢喜。由于财富已经存在于体内，因此该名称比其他人蔓延更多，好处更大。这是一个听到高声音的好房子，但是你为什么不充满欢乐呢？','财富来到门口，因为失明很长。您将在左边互相帮助，因此您需要知道好处是在中间并进行真正的约会。财富无处不在，因此，如果您想完成良好的效果，我们将做出意想不到的牺牲。','不可能说这条路将非常困难，因为它在公司的山脉中丢失了。很难实现希望，因为其他人会击败我。如果您在家，那将很长。','如果您坐在明亮的夜窗旁，您可以做得很好。文档中有一段时间，因此福利将来自扩大土地。','不要走开。缺点在等我。我不能只保留它。您会急于赶往盲人，而大财富进入门？这个男孩已经获得了意义，因此量化了乐器，毫不犹豫。','如果一个人有所帮助，请确保有一件好事。如果您毫不犹豫地让它保持冷静，可以避免它。即使工作将是如此出色，以至于工作不好，也要努力付出越来越多的努力。','2025-03-02 03:02:01.11462+00','c');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (467,'027','華麗な鳥はどのようにしてニュースに会うことができますか？シムホンを走らせてきたハードワークは、1日映画になります。幸運がすでに戻ってきているので、1日でシムホンのすべての価格を取ります。あなたがこれを左に助けるならば、それはそれがそうするように行われます。他の人の助けがあれば、パルスまたは良いご飯ができます。主要な数の記事は幸せでなければなりません。魚がドラゴンをジャンプした場合、あなたは祝福を探しています。名前は1つの世界で奪われるので、あなたは話すことによって駆り立てられます。水の真ん中に、月が見られ、私が続きます。','知性はドアに反映されているので、私はあなたをお互いに扱います。家には斜面があるので、美しい人がカップを勧めるようなものです。恋人に会うことは夢です。家族を増やしたり、家を増やしたりすることで、家族に挨拶します。','私は3時に斜面を持っていることを嬉しく思います、そして、私は金とjaの倉庫でいっぱいになります。名前は軽く、遠くに飛ぶので、それぞれの人がそれを見るでしょう。今月の主要な水はスプリングチップのようなもので、チップは満開です。','たぶん真実があるかもしれないので、私は事前にミョンサン・ダエチョンに行きたいです。真実がある場合は、診療所で明るく走っていると尋ねてください。液体から逃げます。ギル・ソンはドアに反映されているので、私は死の土地を生き延びた人に会います。','最初と終わりは同じなので、きっと嬉しくて貴重です。あなたが人々が得意でないなら、あなたはあなたの年齢を妨げるでしょう。あなたが犠牲にならなければ、真実は圧倒されるはずです。','さまざまな活気のある水が入ってくるので、力は力の左側を享受します。ギルソングはドアに反映されているので、あなたは大人になるか、家族を追加します。まず第一に、あなたは大きな利益を得て、それはその背後に安定しています。','家には斜面があるので、あなたはきっと犠牲に会い、あなたの富を増やすでしょう。どうすれば成功できますか？そうでなければなりません。他の人と戦わないでください。あなたは有益なものによって損傷を受けているかもしれません。','財産がドアに来ると、私たちは犠牲になり、喜ぶでしょう。富は身体の中にあるので、名前は他のものよりも広がり、利益はより大きくなります。高い音を聞くのは良い家ですが、なぜあなたは喜びに満ちていないのですか？','失明が長いので、富はドアに来ます。左側のお互いを助けてくれるので、利益が真ん中にあることを知り、真のデートをする必要があります。富はどこにでもあるので、あなたがそれをうまく仕上げたいなら、私たちは予想外の犠牲を払うでしょう。','道路は堅実な山で失われているため、道路が非常に困難になると言うことは不可能です。他の人が私を打ち負かすので、希望を達成することは困難です。あなたが家にいるなら、それは長くなるでしょう。','明るい夜の窓のそばに座ると、大きな仕事をすることができます。文書には長さがあるため、土地を拡大することから利益が得られます。','去らないでください。不利な点が私を待っています。私はそれを維持することはできません。盲人に急いで急いで急いで、大きな富がドアに来ましたか？少年は意味を獲得したので、楽器は定量化され、ためらうことはありません。','人が助けてくれるなら、良いことがあることを確認してください。あなたがあなたの心に急いでそれを落ち着かせるならば、あなたはそれを避けることができます。仕事が良好であって仕事が良くないとしても、ますます努力してみてください。','2025-03-02 03:02:01.11462+00','j');
